import axios from "axios";
import React, { useEffect } from "react";

export default function AssignMentor(){

    const getStudents=()=>{
        axios.get('http://localhost:8000/createStudent')
        .then((res)=>{
            console.log(res)
        })
        .catch((err)=>{
            console.log(err)
        })
    }


    const getTeachers=()=>{
        axios.get('http://localhost:8000/createTeacher')
        .then((res)=>{
            console.log(res)
        })
        .catch((err)=>{
            console.log(err)
        })
    }
    useEffect(()=>{
         getStudents()
         getTeachers()
    },[])

    return(

      

        <div>
            <p>Assign students </p>
        </div>
    )
}
